import CryptoData from './pages/CryptoData';
import Detail from './pages/Detail';

function App() {


  return (
    <div className="App">
      <NavBar />
      <Switch>
        <Route exact path="/">
          <CryptoData />
        </Route>
        <Route path="/coins/:id" exact component={Detail}>
          {/* <Detail /> */}
        </Route>
      </Switch>
    </div>
  );
}

export default App;
